import React from "react";
import styles from "./banner.module.css";
import { Link } from "react-router-dom";

function Banner() {
  return (
    <>
      <Link to="/product">
        <img src={require("../images/main_banner.png")} alt="logo"/>
      </Link>
    </>
  )
}
export default Banner;
